            resultsDiv.style.display = 'none';
            return;
        }
        
        var matches = officeData.filter(function(feature) {
            return feature.properties.name.toLowerCase().includes(searchTerm) ||
                   feature.properties.apartment.toLowerCase().includes(searchTerm);
        });
        
        if (matches.length > 0) {
            var html = '';
            matches.slice(0, 10).forEach(function(feature) {
                html += '<div style="padding: 8px; cursor: pointer; border-bottom: 1px solid #eee;" ' +
                        'onclick="goToOffice(' + feature.geometry.coordinates[1] + ', ' + 
                        feature.geometry.coordinates[0] + ')" ' +
                        'onmouseover="this.style.backgroundColor='#f0f0f0'" ' +
                        'onmouseout="this.style.backgroundColor='white'">' +
                        '<b>' + feature.properties.name + '</b><br>' +
                        '<small>' + feature.properties.apartment + '</small></div>';
            });
            resultsDiv.innerHTML = html;
            resultsDiv.style.display = 'block';
        } else {
            resultsDiv.innerHTML = '<div style="padding: 8px; color: gray;">검색 결과 없음</div>';
            resultsDiv.style.display = 'block';
        }
        
        if (event.key === 'Escape') {
            resultsDiv.style.display = 'none';
            event.target.value = '';
        }
    }
    
    function goToOffice(lat, lng) {
        // Leaflet 지도 이동 및 줌 설정
        var mapId = document.querySelector('.folium-map').id;
        window[mapId].setView([lat, lng], 17);
        document.getElementById('search-results').style.display = 'none';
    }
    
    // ESC 키로 검색 결과 닫기
    document.addEventListener('keydown', function(e) {
        if (e.key === 'Escape') {
            document.getElementById('search-results').style.display = 'none';
        }
    });
    </script>
